import React, { Fragment } from 'react'

const Team = () => {
  return (<Fragment>
    <div className=" h-pr-fl-ma centered bg-orange" Style="width: 400px; height: 400px;"><div className=" p-a " Style="width: 100px; height: 100px; top: 0px; bottom: 0px; margin: auto; left: -150px; bg-skyblue">asd</div>
    <div className="w-125px h-125px p-a of-h l-0px r-0px t-0px b-0px m-a circle" Style="border: 1px solid; border-color: white;"><div className="w-100 h-100 h-pr-fl-ma bg-red b-s-b-b centered"><span className="w-a h-a h-pr-fl-ma centered ">LOGO</span></div></div>
    </div></Fragment>
  )
}

export default Team
